(1,'DATA18092024142847','CV. ABC','01.534.398.1-731.000','Ahmad Kusasi','Ahmad Kusasi','Jalan Karang Anyar II, Komplek Balitan X, Kelurahan Loktabat Utara, Kecamatan Banjarbaru Utara, Kota Banjarbaru, Provinsi Kalimantan Selatan				','-','Jasa Konstruksi dan Pengadaan Barang Jasa','Kredit Modal Kerja Konstruksi Transaksional','Non Revolving Credit','837719909.9110003','500000000','6 (enam) Bulan termasuk masa flasi selama 3 (tiga) Bulan terhitung sejak tanggal Perjanjian Kredit ditandatangani','Sebagai tambahan dana modal kerja dalam rangka memperlancar paket pekerjaan Konstruksi Pembangunan RKB MIN 3 Tanah Laut sesuai dengan SPK No. 1030/Kw.17.2/PP.00.6/05/2023 tanggal 2 Mei 2023 dengan nilai proyek + PPn sebesar Rp. 2.439.828.000,00 (dua miliar empat ratus tiga puluh sembilan juta delapan ratus dua puluh delapan ribu rupiah) dari Kementerian Agama Provinsi Kalimantan Selatan','<p>CV. SEKUMPUL INDAH MAKMUR didirikan pada tahun 2005 berdasarkan Akta Pendirian CV. SEKUMPUL INDAH MAKMUR No. 14 tanggal 14 Mei 2005 yang dibuat oleh NEDDY FARMANTO, Sarjana Hukum, Notaris selaku Notaris di Kab. Banjar.<br />\nPerseroan telah melakukan 2 (dua) kali perubahan yang dituangkan ke dalam akta sebagai berikut :<br />\n<br />\nAkta Keluar dan Masuk Sebagai Pesero dan Perubahan Anggaran Dasar Perseroan Komanditer CV. SEKUMPUL INDAH MAKMUR No. 138 tanggal 29 Mei 2009 yang dibuat oleh NEDDY FARMANTO, Sarjana Hukum, Notaris selaku Notaris di Kab. Banjar dan telah terdaftar di Kepaniteraan Pengadilan Negeri Martapura No. 42/2009/LEG/PN.MTP tanggal 08 Juni 2009.<br />\n<br />\nAkta Perubahan Anggaran Dasar Perseroan Komanditer CV. SEKUMPUL INDAH MAKMUR No. 33 tahun 29 Juli 2020 yang dibuat oleh ARINI AMALIA, S.H., M.Kn selaku Notaris di Kab. Banjar dan telah terdaftar pada Kementerian Hukum dan Hak Asasi Manusia Republik Indonesia Direktorat Jenderal Administrasi Hukum Umum No. AHU-0024105-AH.01.16 Tahun 2020 tanggal 03 Agustus 2020.<br />\n<br />\nBerdasarkan Akta perubahan (terakhir yang diserahkan oleh persroan) Perubahan Anggaran Dasar Perseroan Komanditer CV. SEKUMPUL INDAH MAKMUR No. 33 tahun 29 Juli 2020 yang dibuat oleh ARINI AMALIA, S.H., M.Kn selaku Notaris di Kab. Banjar disebutkan bahwa :<br />\n<br />\nSUPIAN sebagai Direktur<br />\nSANAH sebagai Pesero Komanditer</p>\n','<p>Berdasarkan Akta Perubahan Anggaran Dasar Perseroan Komanditer CV. SEKUMPUL INDAH MAKMUR No. 33 tahun 29 Juli 2020 yang dibuat oleh ARINI AMALIA, S.H., M.Kn selaku Notaris di Kab. Banjar pada pasal 4 mengenai Modal perseroan bahwa Modal perseroan ini di tentukan sebesar Rp. 500.000.000,00 (lima ratus juta rupiah), dan pada setiap waktu dapat dilihat dan dinyatakan dari buku-bukunya perseroan serta dengan persetujuan para pesero, pemasukan modal di dalam perseroan oleh pesero atau salah seorang dari mereka pada setiap waktu selalu dapat diubah.</p>\n','<p>Mengenai tugas dan wewenang pesero pengurus yang tertuang pada Akta Keluar dan Masuk Sebagai Pesero dan Perubahan Anggaran Dasar Perseroan Komanditer CV. SEKUMPUL INDAH MAKMUR No. 138 tanggal 29 Mei 2009 yang dibuat oleh NEDDY FARMANTO, Sarjana Hukum, Notaris selaku Notaris di Kab. Banjar pada Pasal 5 disebutkan bahwa :<br />\n&ldquo;Penghadap Tuan SUPIANI, adalah pesero pengurus dengan gelaran DIREKTUR yang bertanggung jawab menandatangani atas nama perseroan dan berhak serta berwenang mewakili dan mengikat perseroan dimanapun juga, baik dimuka maupun diluar pengadilan dan menjalankan segala hak dan kekuasaan yang menjadi milik perseroan maupun yang mengenai pengurusan tanpa terkecuali. Sedangkan Tuan SANAH, tersebut adalah sebagai Pesero Komanditer, yang bertanggung jawab hingga pemasukannya dalam perseroan.&rdquo;</p>\n','<p>Hubungan Perseroan dengan&nbsp; pihak Perbankan<br />\nRekening Giro atas nama CV. SEKUMPUL INDAH MAKMUR Nomor Rekening 2003922696 Cabang Martapura Sejak 2021 dnegan riwayat aktif. Data secara rinci dijelaskan pada upload dokumen pendukung.<br />\n<br />\nHubungan Perseroan, Pengurus dan Avalist Perseroan dengan pihak Perbankan<br />\nBerdasarkan IDEB Sistem Layanan Informasi Keuangan OJK dapat digambarkan sebagai berikut:<br />\nCV. SEKUMPUL INDAH MAKMUR berdasarkan Ideb Sistem Layanan Informasi Keuangan OJK Nomor Laporan 25097/IDEB/0101122/2023 tanggal 05 Juni 2023 kondisi lancar.<br />\nSUPIANI (Direktur) berdasarkan Ideb Sistem Layanan Informasi Keuangan OJK Nomor Laporan 25090/IDEB/0101122/2023 tanggal 05 Juni 2023 data tidak ditemukan.<br />\nSANAH (P. Komanditer) berdasarkan Ideb Sistem Layanan Informasi Keuangan OJK Nomor Laporan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; /IDEB/0101122/2023 tanggal 05 Juni 2023 data tidak ditemukan.<br />\nABDUL HADI (Pemilik Agunan) berdasarkan Ideb Sistem Layanan Informasi Keuangan OJK Nomor Laporan 25089/IDEB/0101122/2023 tanggal 05 Juni 2023 kondisi lancar.<br />\nSAUDAH (Istri Pemilik Agunan) berdasarkan Ideb Sistem Layanan Informasi Keuangan OJK Nomor Laporan&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; /IDEB/0101122/2023 tanggal 05 Juni 2023 data tidak ditemukan.<br />\nData secara rinci dijelaskan pada upload dokumen pendukung.<br />\nDari IDEB yang diperoleh di atas dapat disimpulkan bahwa perseroan maupun pengurus perseroan tidak sedang dalam menikmati fasilitas kredit macet atau bermasalah pada bank manapun. Hal tersebut dinilai bahwa dari segi karakter, perseroan maupun pengurus perseroan dinilai memiliki karakter yang baik dalam menjalankan kegiatan usahanya yang bekerja sama melalui perbankan.</p>\n','<p>Landasan hukum dan dasar pendirian CV. SEKUMPUL INDAH MAKMUR adalah sebagai berikut:<br />\nDengan sahnya proses pendirian dinilai telah sesuai dengan aturan hukum yang telah ditetapkan di Negara Indonesia.<br />\n<br />\nAkta Pendirian Nomor 14 tanggal 14-05-2005 Pendaftaran Nomor 37/2005/LEG/PN.MTP tanggal 26-05-2005<br />\nAkta Perubahan Nomor 138 tanggal 29-05-2009&nbsp;Pendaftaran Nomor 42/2009/LEG/PN.MTP tanggal 08-06-2009<br />\nAkta Perubahan Nomor 33 tanggal 29-07-2020 Pendaftaran Nomor AHU-00024105-AH.01.16. Tahun 2020 tanggal 03-08-2020&nbsp;&nbsp;</p>\n','<p><em>Core business&nbsp;</em>perseroan adalah di bidang Jasa Konstruksi dan Pengadaan Barang Jasa serta didukung dengan beberapa perizinan usaha yang dimiliki oleh perseroan sebagai berikut:<br />\n<br />\nNomor Induk Berusaha (NIB) Berbasis Risiko No. 9120105872501 tanggal 20 Agustus 2019 yang diterbitkan oleh OSS System<br />\nSertifikat Badan Usaha Jasa Pelaksanaan Konstruksi (SBUJPK) No. 0-6303-06-002-1-16-038998 tanggal 9 November 2020 masa berlaku sampai dengan 8 November 2023<br />\nSertifikat Badan Usaha Jasa Pelaksanaan Konstruksi (SBUJPK) No. 0-6303-07-002-1-16-038998 tanggal 9 November 2020 berlaku sampai dengan 8 November 2023<br />\nSurat Keterangan Terdaftar No. PEM-00641/WPJ.29/KP0203/ 2014 tanggal 14 Maret 2014&nbsp;-<br />\nSurat Pengukuhan Pengusaha Kena Pajak No. PEM-10278/WPJ.29/KP0203/ 2012 tanggal 14 Maret 2014<br />\nNomor Pokok Wajib Pajak (NPWP) No. 02.215.969.3-732.000&nbsp;-</p>\n','<p>Sebagai dasar pelaksanaan usaha/proyek, didasari dengan adanya Kontrak Kerja/Perjanjian Kerjasama yang dibuat antara perseroan dengan pihak pemberi pekerjaan (bouwheer), yang didalamnya memuat mengenai prosedur kerja dan segala ketentuan yang menyangkut pekerjaan yang akan dilakukan, dalam hal ini adalah paket pekerjaan Konstruksi Pembangunan RKB MIN 3 Tanah Laut sesuai dengan SPK No. 1030/Kw.17.2/PP.00.6/05/2023 tanggal 2 Mei 2023 dengan nilai proyek + PPn sebesar Rp. 2.439.828.000,00 (dua miliar empat ratus tiga puluh sembilan juta delapan ratus dua puluh delapan ribu rupiah) dari Kementerian Agama Provinsi Kalimantan Selatan.</p>\n','<p>Sdr. SUPIANI selaku Direktur CV. SEKUMPUL INDAH MAKMUR dinilai cakap dari segi hukum untuk melakukan perjanjian dengan pihak Bank dimana sesuai dengan pasal 1330 Kitab Undang-Undang Hukum Perdata, dimana dinilai dewasa dan tidak dibawah pengampuan.<br />\nPara pengurus perseroan tidak sedang menghadap suatu litigasi (Proses berperkara melalui pengadilan) yang akibat keputusannya mengubah secara material dan merugikan keuangan dan posisi bisnis debitur.<br />\nAlamat KTP ybsk sesuai dengan alamat tempat tinggal/domisili yang bersangkutan.<br />\nSdr. ABDUL HADI dan Sdri. SAUDAH selaku pemilik agunan dinilai cakap dari segi hukum untuk melakukan perjanjian dengan pihak Bank dimana sesuai dengan pasal 1330 Kitab Undang-Undang Hukum Perdata, dimana dinilai dewasa dan tidak dibawah pengampuan.</p>\n','<p>Dengan memperhatikan hal-hal diatas dari aspek Legalitas dan Yuridis, maka atas Usaha Perseorangan secara Umum dinilai cukup Terjamin dan telah sesuai dengan prosedur dan berketetapan hukum di Negara Indonesia, namun atas beberapa hal yang direkomendasikan agar dapat diperhatikan.</p>\n','<p>Lokasi kantor perseroan dinilai strategis dengan kondisi bangunan cukup representatif untuk usaha yang terletak di Jl. Jambu Raya RT. 03 RW. 00 Desa Jambu Raya Kec. Beruntung Baru Kab. Banjar Prov. Kalimantan Selatan.<br />\n<br />\nKey person yaitu Sdr. SUPIANI selaku Direktur Perseroan dan juga pengurus perseroan lainnya memiliki kemampuan, pengetahuan, dan pengalaman di bidang usaha perseroan sehingga dinilai mampu mengelola perseroan dengan baik.<br />\n<br />\nKey person diketahui memiliki hubungan yang baik dengan mitra usahanya seperti para rekan kerja, para pemasok material, tenaga kerja maupun dengan pihak pemberi pekerjaan (bouwheer) yang memberi pekerjaan secara profesional.<br />\n<br />\nSistem pembukuan dan administrasi perseroan selama ini masih cukup sederhana, namun dinilai cukup memadai untuk menggambarkan keadaan keuangan usaha dan kondisi usaha.<br />\n<br />\nUntuk memperlancar kegiatan usaha perseroan memiliki karyawan tetap yang bertugas sebagai tenaga keuangan dan administrasi sedangkan untuk tenaga lapangan biasanya dipekerjakan pada saat pelaksanaan proyek saja dengan jumlah menyesuaikan kebutuhan proyek dilapangan dan diutamakan tenaga lokal yang ada. Tugas dan wewenang untuk masing-masing tenaga kerja telah didelegasikan dengan baik sehingga operasional usaha dapat berjalan dengan baik.</p>\n','<p>Dilihat dari aspek teknis, maka permohonan kredit modal kerja konstruksi yang diajukan CV. SEKUMPUL INDAH MAKMUR bertujuan untuk tambahan modal kerja dalam rangka memperlancar pekerjaan dengan kontrak terlampir dinilai layak untuk dipertimbangkan mengingat :<br />\n<br />\nSumber dana pekerjaan proyek berasal dari DIPA Pendidikan Islam Kanwil Kementrerian Agama Provinsi Kalimantan Selatan tahun anggaran 2023.<br />\n<br />\nTelah dilakukan konfirmasi melalui On The Spot (OTS) yang dilakukan oleh petugas kredit Bank Kalsel Cabang Banjarbaru kepada Pejabat Pembuat Komitmen (PPK) yang diperoleh informasi bahwa proyek pekerjaan tersebut memang benar didapatkan oleh CV. SEKUMPUL INDAH MAKMUR. (Foto terlampir).<br />\n<br />\nPembayaran pekerjaan proyek tersebut disalurkan ke rekening giro Bank Kalsel Cabang Martapura dengan nomor rekening 2003922696 an. CV. SEKUMPUL INDAH MAKMUR. Hal tersebut tertuang di dalam Surat Perjanjian Kontrak Harga Satuan (terlampir) dan Bank Clereance yang ditandatangani oleh Pejabat Pembuat Komitmen pada instansi terkait.<br />\n<br />\nJangka waktu pelaksanaan pekerjaan tersebut adalah 150 (seratus lima puluh) hari kalender yang terhitung dari tanggal 02 Mei 2023 s.d 28 September 2023<br />\n<br />\nJangka waktu pemeliharan adalah 180 (seratus delapan puluh) hari kalender terhitung sejak tanggal penyerahan pertama pekerjaan.<br />\n<br />\nLokasi proyek sekolah MIN 3 Tanah Laut yang terletak di Jl. Padang Raya Desa Pabahanan Kecamatan Pelaihari Kabupaten Tanah Laut Provinsi Kalimantan Selatan, dimana bahan &ndash; bahan material yang berada di lokasi tersebut berupa pasir, batu split, semen, kayu, besi, tanah merah dan lain &ndash; lain.<br />\n<br />\nSaat ini pekerjaan yang dilakukan pada lokasi proyek yaitu pengerjaan besi tulangan dan pengecoran lubang strauss pile, serta pondasi pasangan batu gunung.<br />\n<br />\nSelama dalam pelaksanaan pekerjaan tersebut perseroan dapat mengambil maksimal 4 kali termijn, selain termijn uang muka dan termijn pemeliharaan.<br />\n<br />\nPerseroan hanya melakukan pengambilan uang muka sebesar &plusmn; 26 % atau sebesar Rp. 647.873.246,00 dari Nilai proyek pada tanggal 17 Mei 2023.<br />\n<br />\nKendala &ndash; kendala yang dihadapi dalam pekerjaan tersebut faktor cuaca yaitu hujan, tetapi dengan pengalaman dari persero kendala &ndash; kendala tersebut dapat teratasi dengan baik, sehingga tidak mempengaruhi pekerjaan Konstruksi Pembangunan RKB MIN 3 Tanah Laut sesuai dengan jangka waktu pekerjaan yang telah disepakati.<br />\n<br />\nDalam kegiatan operasional usaha perseroan didukung fasilitas-fasilitas antara lain :<br />\nKantor yang terletak Jl. Jambu Raya RT. 03 RW. 00 Desa Jambu Raya Kec. Beruntung Baru Kab. Banjar Prov. Kalimantan Selatan (berdasarkan NIB) yang dinilai dapat menunjang pelaksanaan usaha.<br />\nTempat usaha perseroan didukung sarana dan prasarana yang cukup untuk menjalankan usaha.<br />\nDalam rangka memperlancar aktivitas usaha, peralatan utama serta peralatan pembantu lainnya yang dinilai cukup untuk skala usaha yang dijalankan.<br />\nDalam pelaksanaan pekerjaan proyek, perseroan didukung dengan tenaga kerja baik tetap maupun tenaga kerja lepas yang memiliki kemampuan dan pengalaman yang cukup serta didukung dengan sarana dan prasarana kerja yang menunjang untuk pelaksanaan proyek yang didapat dan didukung Peralatan kerja pertukangan serta alat berat dan mesin untuk menunjang kegiatan operasional usaha perseroan.<br />\nSarana transportasi berupa kendaraan roda dua dan kendaraan roda empat.<br />\nBerdasarkan hasil penelusuran pada website LPSE, atas lelang Pekerjaan tersebut diatas memang benar telah dimenangkan oleh CV. SEKUMPUL INDAH MAKMUR (terlampir).<br />\n<br />\nProyek yang dikerjakan pada umumnya dinilai tidak terlalu rumit dan perseroan dinilai mampu menyelesaikan pekerjaan dengan baik dan lancar karena perseroan telah memiliki pengalaman dengan ditunjang oleh tenaga kerja yang ahli dibidang konstruksi dan memiliki alat yang mendukung untuk menjalankan pekerjaan proyek khususnya dibidang konstruksi bangunan.</p>\n','<p>Strategi &amp; Prospek / Rencana Pemasaran / Penjualan :<br />\nBerdasarkan NIB 9120105872501 tanggal 20 Agustus 2019, usaha proyek selama ini sesuai dengan KBLI sebagai berikut :<br />\nKonstruksi Gedung Tempat Tinggal;<br />\nKonstruksi Gedung Kesehatan;<br />\nKonstruksi Gedung Pendidikan;<br />\nKonstruksi Gedung Lainnya;<br />\nKonstruksi Jalan Raya;<br />\nKonstruksi Bangunan Pengolahan, Penyaluran dan Penampungan Air Minum, Air Limbah dan Drainase;<br />\nKonstruksi Bangunan Prasarana Sumber Daya Air;<br />\nPerdagangan Besar Mesin Kantor dan Industri, Suku Cadang dan Perlengkapannya;<br />\nPerdagangan Eceran Komputer dan Perlengkapannya;<br />\nPerdagangan Eceran Barang Logam untuk Bahan Konstruksi;<br />\nPerdagangan Eceran Kertas, Kertas Karton dan Barang Dari Kertas/Karton;<br />\nPerdagangan Eceran Pupuk dan Pemberantas Hama;<br />\nPerdagangan Eceran Mesin Lainnya dan Perlengkapannya;<br />\n<br />\nStrategi pemasaran yang dilakukan selama ini adalah dengan selalu mengerjakan proyek sesuai dengan permintaan dari pihak pemberi pekerjaan atau pihak bouwheer baik dari segi kualitas dan kuantitasnya maupun ketepatan pelaksanaan proyek/pekerjaan. Berikut adalah pengalaman pekerjaan yang telah selesai dikerjakan oleh perseroan pada tahun 2022 sebagai berikut (copy cover kontrak terlampir) :<br />\n1. Renovasi Poned Puskesmas Binuang Kec. Binuang (DAK) T.A 2022 (Sumber : Situs Lembaga Kebijakan Pengadaan Barang/Jasa Pemerintah (LKPP)) Nilai Rp. 1.700.000.000 dari Dinas Kesehatan Kabupaten Tapin<br />\n2. Pembangunan Saluran Drainase Jalan Kayu Tangi Kelurahan Jawa Kec. Martapura (Sumber : situs Lembaga Kebijakan Pengadaan Barang/Jasa Pemerintah (LKPP)) Nilai Rp. 199.500.000 dari Dinas PUPRP Kab. Banjar<br />\n<br />\nTingkat Persaingan<br />\nTingkat persaingan usaha Jasa Konstruksi (sipil, arsitektur) dinilai cukup ketat dengan cukup banyak pengusaha sejenis di Provinsi Kalimantan Selatan pada khususnya maupun diseluruh wilayah Republik Indonesia pada umumnya.&nbsp; Namun pasar usaha jasa konstruksi di Indonesia sangat berpotensi, dimana kegiatan investasi yang dilakukan oleh pemerintah dan sektor swasta setiap tahunnya meningkat. Hal ini, berkaitan juga dengan cakupan wilayah dan jumlah masyarakat (publik) yang mesti mendapatkan pelayanan. Pemanfaatan potensi usaha jasa konstruksi didaerah seperti Kalimantan Selatan dapat dilakukan dengan melibatkan pengusaha lokal secara kompetitif melalui proses yang transparan, adil, efisien dan efektif (ekonomi), serta penegakan hukum.&nbsp; Selain itu, dibutuhkan peningkatan kemampuan (capacity building) kontraktor yang ada didaerah, dan implementasi kebijakan yang berpihak pada pengusaha daerah. Pelibatan usaha jasa konstruksi daerah diharapkan dapat menciptakan lapangan kerja, peningkatan layanan infrastruktur publik dan usaha jasa konstruksi daerah dapat bersaing pada pangsa pasar regional dan pasar domestik.&nbsp; Dikarenakan perseroan telah memiliki pengalaman serta keunggulan yakni ketepatan dan mutu yang dihasilkan dinilai baik oleh pihak bouwheer, maka pihak perseroan dinilai mampu berkompetisi dengan pihak kompetitor lainnya.&nbsp;</p>\n','<p>Analisa Aspek keuangan CV. SEKUMPUL INDAH MAKMUR dapat disampaikan hal sebagai berikut :</p>\n\n<p><br />\nTotal Pendapatan perseroan tahun 2022 mengalami peningkatan dibandingkan dengan tahun 2021 yakni dikarenakan perseroan pada tahun tersebut lebih terbuka dalam mengerjakan proyek dan mengikuti proses lelang proyek pekerjaan, HPP mengalami juga mengalami peningkatan dikarenakan hal tersebut mengikuti sesuai dengan Penjualan ataupun dari pendapatan proyek dikerjakan, biaya Opr Umum dan Adm juga mengikuti dari Penjualan.</p>\n','<p>Analisa Aspek keuangan CV. SEKUMPUL INDAH MAKMUR dapat disampaikan hal sebagai berikut :</p>\n\n<p><br />\nTotal Pendapatan perseroan tahun 2022 mengalami peningkatan dibandingkan dengan tahun 2021 yakni dikarenakan perseroan pada tahun tersebut lebih terbuka dalam mengerjakan proyek dan mengikuti proses lelang proyek pekerjaan, HPP mengalami juga mengalami peningkatan dikarenakan hal tersebut mengikuti sesuai dengan Penjualan ataupun dari pendapatan proyek dikerjakan, biaya Opr Umum dan Adm juga mengikuti dari Penjualan.</p>\n','<p>Agunan yang diserahkan berupa :<br />\n&nbsp;AGUNAN POKOK BERUPA :<br />\nSisa nilai kontrak bersih pada pekerjaan Konstruksi Pembangunan RKB MIN 3 Tanah Laut sesuai dengan SPK No. 1030/Kw.17.2/PP.00.6/05/2023 tanggal 2 Mei 2023 setelah dipotong termijn uang muka, Ppn &amp; Pph serta termijn pemeliharaan adalah sebesar Rp. 1.478.143.239,00.<br />\n<br />\n&nbsp;Agunan Tambahan berupa : (perhitungan FAA terlampir)<br />\n1 (satu) bidang tanah perwatasan beserta segala sesuatu yang tertanam dan berdiri diatasnya sesuai dengan Sertipikat Hak Milik (SHM) No. No. 3568/Alalak Utara Tanggal 23 Juni 2005 atas nama ABDUL HADI (Pihak ke 3), dengan luas tanah 102 m2 sesuai dengan surat ukur no. 296/ALUT/2005 tanggal 21 Juni 2005 yang terletak di Jl. Raga Buana Blok I No. 25A RT. 45 RW. 02 Kel. Alalak Utara Kec. Banjarmasin Utara Kota Banjarmasin Prov. Kalimantan Selatan dengan nilai taksasi setelah CEF dan Safety Margin sebesar Rp. 159.390.938,00.<br />\n&bull;&nbsp;Sehingga Prosentase plafon dengan agunan tambahan untuk KMK Konstruksi adalah sebagai berikut :<br />\n= Rp. 159.390.938,00 : Rp. 500.000.000,00 = 31,88%<br />\nPersentase tersebut telah sesuai dengan Keputusan Direksi Bank Kalsel No. 20/KEP.DIR/DKK/2023 tanggal 12 Juni 2023 perihal Pedoman Kredit Konstruksi Transaksional dan Standby Loan yang disebutkan :<br />\nF.4.&nbsp;Kredit Konstruksi dengan sumber pembayaran dari APBD Provinsi, Kabupaten/Kota, APBN dan atau gabungan dari APBN dan APBD dengan jaminan yang diserahkan minimal 30%, dengan syarat :<br />\n1)&nbsp;Perseroan tercatat pernah minimal 1 (satu) kali dalam 2 (dua) tahun terakhir mengerjakan Kontrak pengadaan barang/ jasa/ kontraktor/ kontrak lainnya yang sumber pembayarannya dari anggaran lembaga/instansi negara (APBD/APBN) dengan track record baik;<br />\n2)&nbsp;Untuk perseroan yang belum pernah ada pengalaman, dapat dimungkinkan diberikan sepanjang pengurus perseroan telah memiliki pengalaman minimal 1 (satu) kali dalam 2 (dua) tahun terakhir.<br />\n<br />\n3)&nbsp;Perseroan tidak pernah menjadi debitur bermasalah (Non Performing Loan) pada Bank Kalsel dan atau bank lain minimal selama 1 (satu) tahun terakhir yang dilihat dalam Laporan Informasi Debitur (SLIK).<br />\n4)&nbsp;Khusus untuk Kredit Konstruksi Transaksional yang bersumber dari APBN atau gabungan dari APBN dan APBD, maka lokasi proyek dan domisili calon debitur harus berada di Provinsi Kalimantan Selatan. Syarat ini juga berlaku untuk calon debitur dengan status Kerja Sama Operasional (KSO), Cabang, dan Kuasa Direktur.<br />\n&bull;&nbsp;Atas agunan tersebut diatas wajib dilakukan pengikatan Hak Tanggungan dan dilakukan pemasangan Asuransi sesuai dengan ketentuan yang berlaku.<br />\n&bull;&nbsp;Agunan atas nama pihak selain debitu/pemohon (pihak ketiga) dapat diterima berdasarkan Keputusan Direksi Bank Kalsel No. 20/KEP.DIR/DKK/2023 tanggal 12 Juni 2023 perihal Pedoman Kredit Konstruksi Transaksional dan Standby Loan dengan syarat Menyerahkan surat pernyataan persetujuan penyerahan dan menjaminkan agunan.<br />\n&bull;&nbsp;Pemilik Agunan tambahan beserta istri wajib ikut serta menandatangani Perjanjian Kredit dan accesoirnya terkait objek agunan kredit sebagai Avalist.</p>\n','KMK Konstruksi','500.000.000,00','-','500.000.000,00','','','','','Kredit Modal Kerja Konstruksi Transaksional','837719909.9110003','500000000','Menengah Segmentasi Komersial','443409909.91100025','Sebagai tambahan dana modal kerja dalam rangka memperlancar paket pekerjaan Konstruksi Pembangunan RKB MIN 3 Tanah Laut sesuai dengan SPK No. 1030/Kw.17.2/PP.00.6/05/2023 tanggal 2 Mei 2023 dengan nilai proyek + PPn sebesar Rp. 2.439.828.000,00 (dua miliar empat ratus tiga puluh sembilan juta delapan ratus dua puluh delapan ribu rupiah) dari Kementerian Agama Provinsi Kalimantan Selatan','6 (enam) Bulan termasuk masa flasi selama 3 (tiga) Bulan terhitung sejak tanggal Perjanjian Kredit ditandatangani','Dilakukan secara bertahap dan disesuaikan dengan progress fisik proyek atau kebutuhan modal kerja proyek dan bersyarat sebagaimana syarat penarikan atau realisasi kredit.				','Setiap pembayaran termijn proyek Konstruksi Pembangunan RKB MIN 3 Tanah Laut akan dipotong minimal sebesar 34 % (tiga puluh empat) sampai dengan kredit dinyatakan lunas oleh pihak bank.				\n','14.5','1.5','7500000','Penandatanganan Perjanjian Kredit dilakukan dibawah tangan dengan legalisasi notaris.				\n','Pokok;tambahan','Sisa nilai kontrak bersih pada pekerjaan Konstruksi Pembangunan RKB MIN 3 Tanah Laut sesuai dengan SPK No. 1030/Kw.17.2/PP.00.6/05/ 2023 tanggal 2 Mei 2023 setelah dipotong termijn uang muka, Ppn & Pph serta termijn pemeliharaan;1 (satu) bidang tanah perwatasan beserta segala sesuatu yang tertanam dan berdiri diatasnya sesuai dengan Sertipikat Hak Milik (SHM) No. No. 3568/Alalak Utara Tanggal 23 Juni 2005 atas nama ABDUL HADI (Pihak ke 3), dengan luas tanah 102 m2 sesuai dengan surat ukur no. 296/ALUT/2005 tanggal 21 Juni 2005 yang terletak di Jl. Raga Buana Blok I No. 25A RT. 45 RW. 02 Kel. Alalak Utara Kec. Banjarmasin Utara Kota Banjarmasin Prov. Kalimantan Selatan dengan nilai taksasi setelah CEF dan Safety Margin','Rp1.478.143.239,00;Rp159.390.938,00','Cessie;Hak Tanggungan','<p>Seluruh dokumen asli bukti kepemilikan atas objek agunan tambahan yang menjadi agunan kredit Wajib diserahkan dan disimpan Bank Kalsel Cabang Banjarbaru</p>\n','<p>Seluruh objek agunan dilakukan pengikatan sesuai dengan ketentuan yang berlaku sehingga memberikan hak preferen kepada pihak Bank Kalsel yakni dengan ketentuan sebagai berikut :<br />\na.&nbsp;Agunan pokok berupa Sisa nilai kontrak bersih setelah dikurangi Termijn Pemeliharaan, PPN 11% dan PPh 1,75% atas pekerjaan di atas diserahkan bersama-sama dengan Akta Cessie dibawah tangan yang wajib dilegalisasi oleh Notaris.<br />\nb.&nbsp;Agunan tambahan berupa Tanah diikat dengan Hak Tanggungan, dengan nominal pembebanan minimal sebesar 145% dari nilai taksasi setelah safety margin.<br />\nc.&nbsp;Pemilik agunan tambahan beserta istri wajib ikut serta menandatangani Perjanjian Kredit dan accecoirnya terkait objek agunan kredit sebagai Avalist.</p>\n','<p>1)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;Wajib dilakukan pemasangan asuransi kredit rekanan Bank Kalsel.<br />\n2)&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Diasuransikan pada maskapai asuransi kredit rekanan Bank Kalsel (telah termasuk dalam penjaminan kekurangan agunan kredit)</p>\n','<p>Untuk meminimalisir risiko pada agunan tambahan, jika terdapat bangunan yang&nbsp;<em>insurable</em>&nbsp;maka wajib diasuransikan pada Maskapai Asuransi Kerugian Umum dengan nilai pertanggungan sesuai dengan harga pejabat bank atau harga perolehan sebelum dikurangi&nbsp;<em>Cash Equivalency Faktor</em>&nbsp;(CEF) dan&nbsp;<em>Safety Margin</em>&nbsp;(SM) dengan jangka waktu pertanggungan minimal sama dengan jangka waktu kredit yang telah disetujui dan klausul untuk kepentingan Bank Kalsel (<em>banker&rsquo;s clause</em>) dengan beban premi ditanggung CV. SEKUMPUL INDAH MAKMUR.</p>\n','<p>a.&nbsp;Debitur telah mengembalikan tembusan Surat Pemberitahuan Persetujuan Kredit (SPPK) yang telah ditandatangani oleh pejabat perusahaan yang berwenang sesuai anggaran dasar perusahaan di atas meterai Rp. 10.000,- dan dibubuhi stempel perusahaan sebagai tanda persetujuan.<br />\nb.&nbsp;Dokumen asli bukti kepemilikan agunan tambahan telah diserahkan pada Bank Kalsel Cabang Banjarbaru untuk dilakukan pengecekan oleh pihak Notaris atau Pejabat Pembuat Akta Tanah (PPAT) atau pihak lainnya yang berwenang guna memastikan agunan yang dijadikan jaminan harus bebas ikatan dengan pihak lain/bank, kecuali adanya surat keterangan atau cover note dari Notaris atau Pihak berwenang bahwa keseluruhan agunan tambahan tersebut layak secara yuridis untuk dapat dilakukan pengikatan.<br />\nc.&nbsp;Telah menyetorkan dana ke rekening Giro an. CV. SEKUMPUL INDAH MAKMUR di Bank Kalsel yang digunakan untuk pembebanan biaya provisi kredit sebesar 1,5% (satu koma lima persen) dari plafon kredit sehubungan dengan fasilitas Kredit yang disetujui.<br />\nd.&nbsp;Telah menyerahkan surat pernyataan yang ditandatangani diatas meterai dan berisikan tentang hal-hal sebagai berikut :<br />\n1)&nbsp;Bersedia membayar seluruh biaya yang timbul sehubungan dengan fasilitas kredit disetujui, tidak terbatas pada biaya asuransi atas agunan, biaya notaris, maupun biaya yang timbul atas fasilitas kredit yang diberikan.<br />\n2)&nbsp;Bersedia melakukan penutupan asuransi atas seluruh agunan kredit sejak fasilitas kredit berjalan sampai dengan dinyatakan lunas oleh pihak Bank.<br />\n3)&nbsp;Dokumen Akta Perubahan Anggaran Dasar Perseroan Komanditer CV. SEKUMPUL INDAH MAKMUR No. 33 tahun 29 Juli 2020 yang dibuat oleh ARINI AMALIA, S.H., M.Kn selaku Notaris di Kab. Banjar merupakan akta terakhir dan tidak ada akta lain setelah akta tersebut.<br />\n4)&nbsp;Perseroan akan menanggung seluruh kewajiban kredit tertunggak yang disebabkan karena terjadi cost over run baik akibat terjadinya perubahan kurs atau sebab lainnya.<br />\n5)&nbsp;Apabila terjadi sesuatu hal hasil termijn tidak mencover pinjaman, maka biaya eskalasi dan biaya pemeliharaan serta sumber lainnya akan diusahakan dan diutamakan untuk penyelesaian pinjaman pada Bank Kalsel Cabang Banjarbaru.<br />\n6)&nbsp;Menyatakan bahwa menjamin, melepaskan dan membebaskan Bank Kalsel dari segala kewajiban, tuntutan hukum, gugatan klaim apapun dari pihak manapun, termasuk debitur serta dari segala kerugian dan risiko, termasuk tetapi tidak terbatas pada adanya sengketa terkait dengan perolehan usaha debitur, yang mungkin akan timbul dikemudian hari sehubungan dengan penggunaan fasilitas kredit dari Bank Kalsel.<br />\n7)&nbsp;Semua data dan atau dokumen permohonan penarikan dana atas Kredit Modal Kerja yang diajukan atau disampaikan ke Bank Kalsel Cabang Banjarbaru adalah benar sesuai dengan aslinya. Apabila kemudian hari ditemukan kekeliruan/kesalahan atau dokumen yang disampaikan tidak benar, maka segala akibat yang terjadi secara hukum akan menjadi tanggung jawab debitur sepenuhnya dan melepaskan Bank Kalsel dari segala tuntutan atau gugatan hukum apapun dikemudian hari.<br />\n8)&nbsp;Membebaskan pihak Bank Kalsel dari segala tuntutan atas tindakan melanggar hukum (illegal) sehubungan dengan penggunaan dana kredit oleh Debitur.<br />\n9)&nbsp;Tidak memperjualbelikan/mengalihkan hak atas pekerjaan kepada pihak lain (seperti kuasa direktur, sub kontraktor, dsb.) sebelum dinyatakan lunas oleh pihak Bank.</p>\n','<p>a.&nbsp;Seluruh syarat-syarat penandatanganan Perjanjian Kredit telah dipenuhi.<br />\nb.&nbsp;Perjanjian kredit dan accesoirnya telah ditandatangani oleh pejabat perusahaan yang berwenang sebagaimana diatur dalam anggaran dasar perseroan dan ketentuan serta perundang-undangan yang berlaku.<br />\nc.&nbsp;Telah dilakukan pembebanan atas seluruh biaya yang timbul sehubungan dengan fasilitas Kredit Modal Kerja Konstruksi (Transaksional) yang disetujui.<br />\nd.&nbsp;Seluruh Objek agunan tambahan dipastikan secara legal dapat diikat sesuai dengan ketentuan yang berlaku sehingga memberikan hak preferen kepada pihak Bank Kalsel, minimal adanya surat keterangan/Cover Note dari Notaris yang ditunjuk oleh Bank.<br />\ne.&nbsp;Penarikan dana kredit disesuaikan dengan kebutuhan modal kerja atau progress fisik dari pekerjaan proyek.<br />\nf.&nbsp;Pelaksanaan penarikan KMK Konstruksi (transaksional) wajib dilakukan secara bertahap atau sesuai kebutuhan dengan ketentuan :<br />\n-&nbsp;Penarikan tahap 1 (satu) untuk agunan &gt; 30 % s/d &lt; 75% maksimal penarikan sebesar 30%.<br />\ng.&nbsp;Proses penarikan dana kredit tahap 1 :<br />\n1.&nbsp;Debitur mengajukan permohonan penarikan dana kredit.<br />\n2.&nbsp;Pemasar mengadministrasikan permohonan penarikan dana kredit.<br />\n3.&nbsp;Koordinator Pemasar membuat nota permohonan pencairan dana kredit tahap 1 yang dilampiri permohonan penarikan dana dari debitur dan diserahkan kepada Staf Transaksi Kredit/Unit Kerja Terkait untuk ditindaklanjuti dengan proses pencairan dana ke rekening giro debitur.<br />\nh.&nbsp;Proses penarikan dana kredit tahap 2 dan seterusnya :<br />\n1.&nbsp;Debitur mengajukan permohonan penarikan dana kredit.<br />\n2.&nbsp;Pemasar mengadministrasikan permohonan penarikan dana kredit.<br />\n3.&nbsp;Pemasar menyiapkan Surat Tugas yang ditandatangani oleh Koordinator Pemasar untuk pelaksanaan on the spot (OTS) konfirmasi progress kontrak yang dibiayai.<br />\n4.&nbsp;Pemasar meminta laporan progress dari konsultan terakhir dan bukti realisasi penarikan dana sebelumnya jika terdapat progress konstruksi yang belum diakui pada laporan progress dari konsultan, selanjutnya Pemasar dan Koordinator Pemasar melaksanakan on the spot (OTS) guna peninjauan progress fisik pekerjaan. Hasil on the spot (OTS) dituangkan melalui Formulir Call Report (FCR).<br />\n5.&nbsp;Pemasar dan Koordinator Pemasar melaksanakan on the spot (OTS) guna peninjauan progress fisik pekerjaan dan konfirmasi kepada bouwheer (disertai bukti laporan proyek). Progress fisik pada saat penarikan setidaknya dapat menggambarkan jumlah dana yang tersedia/digunakan sebelumnya yang terdiri dari dana penarikan kredit tahap sebelumnya (disertai bukti realisasi), dana sendiri, dan termijn yang diterima (jika ada). Hasil on the spot (OTS) dituangkan melalui Formulir Call Report (FCR).<br />\n6.&nbsp;Pemasar dan Koordinator Pemasar membuat Memo Penarikan Dana Kredit Konstruksi (MPDKK) untuk menggambarkan kebutuhan dana sebagaimana hasil konfirmasi progress pengadaan atau hasil on the spot (OTS).<br />\ni.&nbsp;Koordinator Pemasar menyerahkan permohonan penarikan dana dan Memo Penarikan Dana Kredit Konstruksi (MPDKK) yang telah disetujui kepada Staf Transaksi Kredit/Unit Kerja Terkait untuk dapat dilakukan proses pencairan dana kredit ke rekening giro debitur.</p>\n','<p>Debitur dalam menjalankan kegiatan usahanya diwajibkan melakukan tindakan-tindakan sebagai berikut :<br />\na.&nbsp;Fasilitas kredit hanya dapat dipergunakan dalam rangka melaksanakan pekerjaan Konstruksi Pembangunan RKB MIN 3 Tanah Laut sesuai dengan SPK No. 1030/Kw.17.2/PP.00.6/05/2023 tanggal 2 Mei 2023 dengan nilai proyek + PPn sebesar Rp. 2.439.828.000,00 (dua miliar empat ratus tiga puluh sembilan juta delapan ratus dua puluh delapan ribu rupiah) dari Kementerian Agama Provinsi Kalimantan Selatan.<br />\nb.&nbsp;Penyaluran transaksi keuangan atas pembayaran termijn proyek wajib disalurkan melalui rekening perseroan/debitur pada Bank Kalsel.<br />\nc.&nbsp;Debitur diwajibkan untuk memberikan konfirmasi kepada pihak Bank Kalsel baik itu secara lisan maupun tertulis apabila ada pembayaran termijn proyek dari bouwheer untuk dilakukan pemotongan angsuran kredit.<br />\nd.&nbsp;Apabila terjadi sesuatu hal hasil termijn tidak men-cover fasilitas kredit, maka biaya eskalasi dan biaya pemeliharaan serta sumber lainnya dari debitur diutamakan untuk penyelesaian fasilitas kredit.<br />\ne.&nbsp;Melaksanakan secara penuh kewajiban material sehubungan dengan Proyek serta tunduk dan selalu mematuhi peraturan perundang-undangan terkait dengan Proyek, serta memenuhi seluruh ketentuan hukum yang dapat mempengaruhi kemampuan Debitur untuk menjalankan Proyek.<br />\nf.&nbsp;Melaporkan kepada pihak Bank setiap perubahan kepemilikan saham atau susunan kepengurusan serta menyerahkan setiap akta perubahan pada kesempatan pertama.<br />\ng.&nbsp;Menginformasikan kepada pihak Bank dan melakukan upaya penyelesaian apabila terdapat sengketa dengan pihak lain atau tuntutan hukum dari pihak lain.<br />\nh.&nbsp;Mempertahankan dan memelihara aset usaha seperti semua sarana atau prasarana dan peralatan kerja selalu dalam keadaan terpelihara baik.<br />\ni.&nbsp;Sertifikat Hak Milik (SHM) sebagai bukti kepemilikan tanah yang menjadi agunan kredit disimpan pada Bank Kalsel Cabang Banjarbaru sampai fasilitas kredit dinyatakan Lunas oleh pihak Bank Kalsel.<br />\nj.&nbsp;Memperkenankan pihak Bank melakukan peninjauan untuk melakukan penilaian terhadap aset milik debitur yang menjadi agunan untuk mem-backup fasilitas kredit atau melakukan pemeriksaan terhadap administrasi, keuangan, dan fisik pada lokasi usaha yang dibiayai.<br />\nk.&nbsp;Seiring dengan semakin besarnya perkembangan usaha yang dijalankan perseroan, untuk menghadapi tingkat persaingan agar perseroan dapat terus eksis dan diharapkan kepada perseroan agar tetap fokus untuk menata manajemen usaha secara lebih profesional, konsisten memisahkan kekayaan perusahaan dengan kekayaan pengurusnya, konsisten dengan perencanaan bisnis kedepan, tertib administrasi, melakukan pengelolaan keuangan dengan baik dan senantiasa mengembangkan kemampuan SDM.<br />\nl.&nbsp;Menjalankan kegiatan usaha sesuai dengan protokol keselamatan dan kesehatan kerja (K3) secara berkesinambungan sesuai dengan UU No.1 tahun 1970 serta mematuhi protokol kesehatan COVID-19 atau sesuai dengan aturan Pemerintah yang berlaku.<br />\nm.&nbsp;Menjaga kualitas fasilitas kredit yang sedang dinikmati baik oleh perseroan maupun para pengurusnya pada Bank Kalsel maupun Bank Lain dikategorikan Lancar.</p>\n','<p>Tindakan debitur dibatasi untuk melakukan hal-hal sebagai berikut :<br />\na.&nbsp;Melakukan pinjaman pada Bank lain (double financing) untuk usaha dan keperluan yang sama.<br />\nb.&nbsp;Melakukan tindakan tercela yang dapat mengakibatkan berhubungan dengan pihak berwajib dan dalam hal litigasi (proses perkara melalui pengadilan) serta hal-hal yang mengakibatkan pailitnya usaha.<br />\nc.&nbsp;Menjual objek agunan yang mem-backup fasilitas kredit di Bank Kalsel sebelum kredit dinyatakan lunas tanpa pemberitahuan dan persetujuan tertulis dari Bank&nbsp; Kalsel.<br />\nd.&nbsp;Mengikatkan diri sebagai penjamin hutang atau menjaminkan harta kekayaan perusahaan yang sudah dijaminkan ke Bank Kalsel kepada pihak lain.<br />\ne.&nbsp;Mengalihkan/menyerahkan kepada pihak lain, sebagian atau seluruhnya atas hak dan kewajiban yang timbul berkaitan dengan fasilitas kredit Debitur pada Bank Kalsel.<br />\nf.&nbsp;Mengajukan permohonan pernyataan pailit kepada Pengadilan Niaga untuk menyatakan pailit diri debitur sendiri.<br />\ng.&nbsp;Melakukan hal-hal lain yang bertentangan dengan ketentuan bank teknis yang berlaku pada Bank Kalsel.</p>\n','<p>a.&nbsp;Sebelum penandatanganan Perjanjian Kredit, Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru wajib meneliti kembali keabsahan setiap dokumen legal yang diserahkan oleh Debitur dengan memberikan cap / stempel &rdquo;telah diperiksa sesuai dengan aslinya&rdquo; yang disertai dengan tanda tangan / paraf pemeriksa serta tanggal waktu pemeriksaan tersebut apabila telah diyakini keasliannya.<br />\nb.&nbsp;Sebelum penandatanganan Perjanjian Kredit, Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru agar memastikan pembayaran/penerimaan termijn atas proyek yang dikerjakan yang menjadi agunan pokok di Bank Kalsel melalui transaksi rekening koran giro maupun konfirmasi ke pihak Bouwheer bahwa perseroan belum menerima pembayaran termijn selain termijn uang muka sebelum kredit direalisasi, apabila perseroan menerima pembayaran termijn selain termijn uang muka maka plafond yang diberikan akan di analisa ulang dan disesuaikan kembali.<br />\nc.&nbsp;Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru wajib menyampaikan surat penegasan kepada pihak pemilik proyek (bouwheer) perihal penyaluran termijn pembayaran atas proyek yang telah dibiayai melalui fasilitas Kredit Modal Kerja Konstruksi setelah proses pelaksanaan akad kredit.<br />\nd.&nbsp;Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru telah memastikan perseroan telah menyerahkan Garansi Bank Pelaksanaan terkait proyek yang akan dibiayai kepada pihak Bouwheer.<br />\ne.&nbsp;Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru agar secara aktif melakukan pemantauan atau memonitor proyek pekerjaan terkait dengan penggunaan dana kredit yang dimintakan bantuan pembiayaannya melalui Bank Kalsel. Hasil kegiatan tersebut agar didokumentasikan serta wajib dituangkan dalam Formulir Call Report (FCR) dan dimasukkan pada berkas kredit perseroan.<br />\nf.&nbsp;Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru agar memantau setiap penerimaan termijn proyek perseroan baik melalui Pejabat Pembuat Komitmen (Pimpro) atau Bendahara proyek maupun rekening perseroan, hasil termijn agar diikuti untuk penyelesaian kewajiban pokok dan bunga kredit.<br />\ng.&nbsp;Melakukan koordinasi dengan Seksi Pelayanan Nasabah Cabang Banjarbaru untuk memberikan warning dan melakukan buka tutup blokir rekening giro perseroan atas permohonan debitur terhadap adanya fasilitas kredit yang diajukan/dibiayai, sehingga dapat memonitoring setiap pembayaran termijn atas proyek yang dibiayai oleh Bank Kalsel Cabang Banjarbaru dan dilakukan pembayaran pokok dan bunga sesuai persentase pemotongan kredit.<br />\nh.&nbsp;Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru agar memonitoring dan memastikan proses pengikatan Hak Tanggungan atas agunan yang diserahkan serta pemasangan pertanggungan asuransi agunan.<br />\ni.&nbsp;Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru agar mengkomunikasikan ketentuan teknis Bank Kalsel terkait fasilitas kredit yang diberikan agar debitur memahami kewajibannya terkait fasilitas kredit yang diberikan dalam rangka tertibnya dokumentasi dan adminsitrasi kredit debitur pada Bank Kalsel.<br />\nj.&nbsp;Koordinator Pemasar Komersial &amp; Korporat Cabang Banjarbaru agar melakukan dokumentasi berkas kredit dengan baik dan aktif memantau perizinan usaha serta kelengkapan dokumen kredit atas nama perseroan secara berkala sehingga dapat diketahui jika terdapat kekurangan atau perizinan yang masa berlaku habis.<br />\nk.&nbsp;Koordinator Komersial &amp; Korporat Cabang Banjarbaru agar selalu memantau perputaran transaksi keuangan nasabah dan melakukan pembinaan atas usahanya agar selalu menjalankan prinsip usaha yang sehat, pengelolaan manajemen usaha yang profesional, costumer service oriented, program pemasaran yang baik dan pembinaan hubungan yang baik dengan berbagai pihak.<br />\nl.&nbsp;Syarat lainnya sesuai dengan keputusan kredit, sepanjang tidak bertentangan dengan syarat dan ketentuan diatas serta tetap mengacu pada prinsip kehati-hatian.</p>\n','AAKPKoordinator','2024-10-11 15:20:23','001'),
